CREATE PROCEDURE dbo.proc_transform_319
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_319
    SET payload = LEFT(payload, 1000) + N'|V4-319|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_319;
END
